import React from "react";
import PropTypes from "prop-types";

const ShelfChangerMov = props => {
  return (
    <div className="book-shelf-changer">
      <select
        onChange={props.shelfChanger}
        value={!props.value ? process.env.REACT_APP_NONE : props.value}
      >
        <option disabled>{process.env.REACT_APP_MOVE_TO}</option>
        <option data-bookid={props.bookItem.id}>
          {process.env.REACT_APP_CURR_READ}
        </option>
        <option data-bookid={props.bookItem.id}>
          {process.env.REACT_APP_WANT_READ}
        </option>
        <option
          data-bookid={props.bookItem.id}
          value={process.env.REACT_APP_READ}
        >
          {process.env.REACT_APP_READ}
        </option>
        <option data-name={props.bookItem.title}>
          {process.env.REACT_APP_NONE}
        </option>
      </select>
    </div>
  );
};

ShelfChangerMov.propTypes = {
  shelfChanger: PropTypes.func.isRequired,
  bookItem: PropTypes.object.isRequired
};

export default ShelfChangerMov;
